// SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.12;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

contract NFTest is ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    function safeMint(address to) public onlyOwner {
        _safeMint(to, _tokenIds.current());
        _tokenIds.increment();
    }

    // START OVERRIDES
    function _transferOwnership(address newOwner)
        internal
        override
    {
        _owner = newOwner;
        super._transferOwnership(newOwner);
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId)
        internal
        override
    {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function _burn(uint256 tokenId) 
        internal
        override
    {
        super._burn(tokenId);
    }

    /**
        Returns URI for specified tokenId
    */
    function tokenURI(uint256 tokenId)
        public
        view
        override
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
    // END OVERRIDES

    event NewToken(uint256 id);
    event TokenAvailable(uint256 tokenId, uint price);
    event TokenUnavailable(uint256 tokenId);
    event TokenPurchased(uint256 tokenId, uint price);
    event TokenUsed(uint256 tokenId, uint8 usage);
    event TokenBurned(uint256 tokenId);
    //event NftBought(address _seller, address _buyer, uint256 _price);

    address private _owner;
    uint private _price;
    uint private _percentage;
    uint8 private _usage;
    string private _url;

    mapping (uint256 => address) public nftToOwner;
    mapping (uint256 => uint8) public nftToUsage;
    mapping (uint256 => uint16) public nftToState;
    mapping (uint256 => uint) public nftToPrice;
    mapping (address => uint) ownerNftCount;
    // TRACK BURNED TOKENS?

    struct NFTs {
        uint256 id;
        string tokenURI;
    }
    NFTs[] public nfts;

    constructor () ERC721("NFTest", "PTT")
    {
        _owner = msg.sender;
        _price = 1;
        _usage = 10;
        _percentage = 10;
    }

    /**
        Sets URL
     */
    function setUrl(string memory url)
        public 
        onlyOwner
        returns (string memory)
    {
        _url = url;
        return _url;
    }

    /**
        Get URL
     */
    function getUrl()
        public
        view
        returns (string memory)
    {
        return _url;
    }

    /**
        Sets NFT price
     */
    function setPrice(uint newPrice)
        public 
        onlyOwner
        returns (uint)
    {
        _price = newPrice;
        return _price;
    }

    /**
        Get NFT price
     */
    function getPrice()
        public
        view
        returns (uint)
    {
        return _price;
    }

    /**
        Get contract owner
     */
    function getOwner()
        public
        view
        returns (address)
    {
        return _owner;
    }

    /**
        Gets ETH held by contract
     */
    function getBalance()
        public
        onlyOwner
        view
        returns (uint256)
    {
        return address(this).balance;
    }

    /**
        Transfers ETH held by contract to contract owner
     */
    function getEth()
        public 
        onlyOwner
        returns (uint256)
    {
        uint256 balance = address(this).balance;
        payable(_owner).transfer(balance);

        return balance;
    }

    /**
        Utility --> Associates owner with NFT and updates NFT count
     */
    function associateNftWith(address owner, uint256 tokenId) 
        private
    {
        nftToOwner[tokenId] = owner;
        nftToUsage[tokenId] = _usage;
        ownerNftCount[owner]++;

        emit NewToken(tokenId);
    }

    /**
        Contract owner can create NFT at no cost
        Sends to specified address
     */
    function allocateNft(address recipient) 
        public
        onlyOwner
        returns (uint256)
    {
        return createNft(recipient);
    }

    /**
        Allows any address to buy an NFT
     */
    function buyNft() 
        external 
        payable 
        returns (uint256)
    {
        require(msg.value >= _price, "Insufficient funds");
        return createNft(msg.sender);
    }

    /**
        Utility --> Creates NFT
     */
    function createNft(address recipient) 
        private
        returns (uint256)
    {
        uint256 newItemId = _tokenIds.current();
        _tokenIds.increment();
        _mint(recipient, newItemId);

        string memory tokenUrl = createTokenURI(newItemId);
        _setTokenURI(newItemId, tokenUrl);

        nftToState[newItemId] = 10000;
        nftToPrice[newItemId] = 0;

        associateNftWith(recipient, newItemId);
        nfts.push(NFTs(newItemId, tokenUrl));

        return newItemId;
    }

    /**
        Gets list of owners NFTs
     */
    function getNftByOwner(address owner) 
        external
        view
        returns (uint[] memory) 
    {
        uint[] memory result = new uint[](ownerNftCount[owner]);
        uint counter = 0;
        for (uint i = 0; i < nfts.length; i++) {
            if (nftToOwner[i] == owner) {
                result[counter] = i;
                counter++;
            }
        }
        return result;
    }

    /**
        Gets NFT state
     */
    function getNftState(uint256 tokenId) 
        external
        view
        returns (uint16) 
    {
        return nftToState[tokenId];
    }

    /**
        Sets NFT state
     */
    function setNftState(uint256 tokenId, uint16 state) 
        external
        returns (uint16) 
    {
        require(msg.sender == nftToOwner[tokenId], "Invalid token owner");
        nftToState[tokenId] = state;

        useToken(tokenId);

        return state;
    }

    /**
        Get remaining usage available for token
     */
    function getNftUsage(uint256 tokenId) 
        external
        view
        returns (uint8) 
    {
        return nftToUsage[tokenId];
    }

    /**
        Get remaining usage available for token
     */
    function useToken(uint256 tokenId) 
        public
        returns (uint8) 
    {
        require(msg.sender == nftToOwner[tokenId], "Invalid token owner");

        uint8 usage = nftToUsage[tokenId];
        require(usage > 0, "Token usage depleted");

        emit TokenUsed(tokenId, usage);

        usage--;
        nftToUsage[tokenId] = usage;
        if (usage == 0) {
            burnToken(msg.sender, tokenId);
        }
        return usage;
    }

    /**
        Allow token purchase
     */
    function allowTokenSale(uint256 tokenId, uint newPrice) 
        public
        returns (uint) 
    {
        require(msg.sender == nftToOwner[tokenId], "Invalid token owner");
        require(newPrice > 0, "Invalid token price");

        nftToPrice[tokenId] = newPrice;
        emit TokenAvailable(tokenId, newPrice);

        return newPrice;
    }

    /**
        Is token available for purchase
     */
    function isTokenAvailable(uint256 tokenId) 
        public
        view
        returns (uint) 
    {
        return nftToPrice[tokenId];
    }

    /**
        Disallow token purchase
     */
    function disallowTokenSale(uint256 tokenId) 
        public
        returns (uint) 
    {
        require(msg.sender == nftToOwner[tokenId], "Invalid token owner");

        nftToPrice[tokenId] = 0;
        emit TokenUnavailable(tokenId);

        return 0;
    }

    /**
        Purchase Token
        https://stackoverflow.com/questions/67317392/how-to-transfer-a-nft-from-one-account-to-another-using-erc721
     */
    function buyOwnedToken(uint256 tokenId) 
        public
        payable
        returns (uint256) 
    {
        require(nftToPrice[tokenId] > 0, "Token not available");
        require(msg.value >= nftToPrice[tokenId], "Insufficient funds");

        address seller = ownerOf(tokenId);
        _transfer(seller, msg.sender, tokenId);
        nftToPrice[tokenId] = 0;

        payable(seller).transfer( (msg.value * (100 - _percentage)) / 100 );
        nftToOwner[tokenId] = msg.sender;
        ownerNftCount[msg.sender]++;
        ownerNftCount[seller]--;

        emit TokenPurchased(tokenId, msg.value);

        return tokenId;
    }

    /**
        Utility --> Burn token
     */
    function burnToken(address owner, uint256 tokenId) 
        private
        returns (uint) 
    {
        _burn(tokenId);

        ownerNftCount[owner]--;
        nftToOwner[tokenId] = 0x0000000000000000000000000000000000000000;
        ownerNftCount[0x0000000000000000000000000000000000000000]++;

        emit TokenBurned(tokenId);

        return 0;
    }

    /**
        Utility --> Creates TokenURI
     */
    function createTokenURI(uint256 tokenId) 
        private
        view
        returns (string memory)
    {
        return string(abi.encodePacked(_url, Strings.toString(tokenId)));
    }

}
